import React, { useEffect, useState } from 'react';
import api from '../services/api';

const WalletRow = ({ w }) => (
  <div style={{ display:'flex', alignItems:'center', justifyContent:'space-between', border:'1px solid #7B68EE', borderRadius:8, padding:'8px 12px', marginBottom:8 }}>
    <div>
      <div style={{ fontFamily:'monospace', fontSize:13 }}>{w.address}</div>
      <div style={{ fontSize:12, opacity:0.8 }}>{w.balanceSOL} SOL {w.type === 'source' ? '(deposit)' : ''}</div>
    </div>
    <button onClick={() => navigator.clipboard.writeText(w.address)}>Copy</button>
  </div>
);

const WalletManager = ({ numWallets, onChanged }) => {
  const [count, setCount] = useState(1);
  const [removeCount, setRemoveCount] = useState(1);
  const [confirmText, setConfirmText] = useState('');
  const [list, setList] = useState([]);
  const [loading, setLoading] = useState(true);

  const refresh = async () => {
    try {
      const res = await api.get('/wallets/list');
      setList(res.data.wallets || []);
    } catch (e) {
      console.error(e);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => { refresh(); }, []);

  const add = async () => {
    try {
      await api.post('/wallets/manage', { action: 'add', count: Number(count) || 1 });
      await refresh();
      onChanged?.();
    } catch (e) { alert('Error adding wallets'); }
  };

  const remove = async () => {
    if (confirmText !== 'confirm') return alert('Type "confirm" to delete');
    try {
      await api.post('/wallets/manage', { action: 'remove', count: Number(removeCount) || 1, confirm: 'confirm' });
      setConfirmText('');
      await refresh();
      onChanged?.();
    } catch (e) { alert('Error removing wallets'); }
  };

  return (
    <div style={{ margin: '16px 0', border:'1px solid #7B68EE', borderRadius:8, padding:12 }}>
      <h2>Wallet Management</h2>
      <p>Current Sub-Wallets: {numWallets}</p>

      <div style={{ display:'flex', gap:10, alignItems:'center', flexWrap:'wrap' }}>
        <button title="Add wallets" onClick={add} style={{ fontWeight:700, width:36, height:36, borderRadius:18 }}>＋</button>
        <input type="number" min="1" value={count} onChange={(e) => setCount(e.target.value)} style={{ width:80 }} />
        <span style={{ opacity:0.8 }}>Add</span>

        <button title="Remove wallets" onClick={remove} style={{ fontWeight:700, width:36, height:36, borderRadius:18, background:'#b34d6e' }}>－</button>
        <input type="number" min="1" value={removeCount} onChange={(e) => setRemoveCount(e.target.value)} style={{ width:80 }} />
        <input type="text" value={confirmText} onChange={(e) => setConfirmText(e.target.value)} placeholder='type "confirm"' />
      </div>

      <div style={{ marginTop:16 }}>
        <h3>Your Generated Wallets</h3>
        {loading ? <em>Loading…</em> : (list.length === 0 ? <p>No wallets yet.</p> :
          list.map((w) => <WalletRow key={w.address} w={w} />))}
      </div>
    </div>
  );
};

export default WalletManager;
